import { Button } from "antd";
import Link from "next/link";
import Router from "next/router";
// link里的as和router.push中的第二个参数是叫url masking
export default () => {
  function goB() {
    Router.push(
      {
        pathname: "/test/b",
        query: {
          id: 2
        }
      },
      "test/b/2"
    );
  }
  return (
    <>
      <Link href="/a?id=1" as="/a/1" title="lalal">
        <Button> lalalabababababbalall </Button>
      </Link>
      <button onClick={goB}>test b</button>
    </>
  );
};
